import React from "react";
import { Link } from "react-router-dom";
import { Button, Form, FormGroup, Label, Input, FormText } from "reactstrap";

import Select from "@atlaskit/select";
// import Button from "@atlaskit/button";

// import Form, {
//   Field,
//   FieldGroup,
//   FormHeader,
//   FormSection,
//   FormFooter
// } from "@atlaskit/form";

import "./lhs.css";

export default class LHS extends React.Component {
  constructor(props) {
    super(props);

    // Set initial state
    this.state = {
      name: ""
    };
  }

  render() {
    return (
      <div className="col-md-4 lhs">
        {/* <div className="title">
          <h5>Configure test case</h5> 
          Configure test case
        </div> */}

        <div className="body">
          <h3>
            <i class="fas fa-cogs" /> Configure fractal generation
          </h3>

          <FormGroup>
            <Label>Number of RPis</Label>
            <Input type="select" name="select" className="at-select">
              <option value="" disabled selected>
                Select your option...
              </option>
              <option>1</option>
              <option>2</option>
              <option>3</option>
              <option>4</option>
              <option>5</option>
            </Input>
          </FormGroup>

          {/* <Field label="Number of threads">
            <Select />
          </Field>

          <Field label="Iterations">
            <Select />
          </Field>

          <Field label="Threshold">
            <Select />
          </Field> */}

          <br />
          <div
            className="btn btn-lg btn-primary w-100 text-left"
            onClick={this.props.runTest}
          >
            Generate fractals <i className="fas fa-arrow-right fa-sm ml-2" />
          </div>
        </div>

        {/* <div>pis, threads, iterations, threashold</div> */}

        {/* <Field label="Field 1"> */}

        {/* </Field> */}
      </div>
    );
  }
}
